<!DOCTYPE html>
<html>
  <head>
    <title>NeetoCal Embed</title>
  </head>
  <body>
    <div style="height: 768px; width: 100%;" id="inline-embed-container">
      <!-- NeetoCal widget will be added here -->
    </div>
    <script>
      window.neetoCal = window.neetoCal || {
        embed: function () {
          (neetoCal.q = neetoCal.q || []).push(arguments);
        },
      };
    </script>
    <script async src="https://compassofficial.neetocal.com/javascript/embed.js"></script>
    <script>
      neetoCal.embed({
        type: "inline",
        id: "66470e04-9722-44bb-96e0-29ace010989c",
        organization: "compassofficial",
        elementSelector: "#inline-embed-container",
        styles: { height: "100%", width: "100%" },
        isSidebarAndCoverImgHidden: "true",
      });
    </script>
  </body>
</html>
